import React from "react";
import "../index.css";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import { styled } from "@mui/material/styles";
import Card from "@mui/material/Card";
import { useParams } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faTwitter, faLinkedin, faGithub, faInstagram, faYoutube } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faFile } from "@fortawesome/free-solid-svg-icons";
import { faFilePdf } from "@fortawesome/free-solid-svg-icons";


import { Link } from "react-router-dom";



const Project = () => {
  const { id } = useParams();
  const [project, setProject] = React.useState(null);
  const [isLoading, setIsLoading] = React.useState(true);

  React.useEffect(() => {
    const fetchProject = async () => {
      const response = await fetch(
        `http://localhost:3000/projects.json/${id}`,
        {
          headers: {
            Authorization: `Bearer ${process.env.REACT_APP_AIRTABLE_KEY}`,  
          },
        }
      );
      const data = await response.json();
      setProject(data);
      setIsLoading(false);
    };
    fetchProject();
  }, [id]);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="project-detail">
      <div className="project-detail-image">
        <img src={project.fields.image} alt={project.fields.title} />
      </div>
      <div className="project-detail-content">
        <h2>{project.fields.title}</h2>
        <p>{project.fields.description}</p>
        <div className="project-detail-links">
          <a href={project.fields.link} target="_blank">
            <FontAwesomeIcon icon={faExternalLinkAlt} />
          </a>
          <a href={project.fields.github} target="_blank">
            <FontAwesomeIcon icon={faGithub} />
          </a>
        </div>
      </div>
    </div>
  );
};

export default Project;
